import './App.css';
import Todo from './Todo';

function Todolist({todos, onDelete, onCompleted}) {  
  return (
    <div>
      <div className="ListOfTodos">
        {todos.map((todo) => (
          <Todo key={todo.id} todo={todo} onDelete={onDelete} onCompleted={onCompleted}/>
        ))}
      </div>
    </div>
  );
}

export default Todolist;
